import React from "react";

const RightContainer = () => {
  return (
    <div>
      <h1>You currently have 3 requests</h1>
      <div>
        <div>
          <h1> St Judes Hospital</h1>
        </div>
      </div>
    </div>
  );
};

export default RightContainer;
